import { BUDGET_CHANGE } from "../config/actionType";
const INITIAL_STATE = {
  budget: 0,
  items: [],
  categorie: ""
};
export default (state = INITIAL_STATE, action) => {
  switch (action.type) {
    case BUDGET_CHANGE:
      console.log("[Action]BudgetChnage", BUDGET_CHANGE, "state", state);
      return { ...state, budget: action.payload };
      break;

    default:
      return state;
      break;
  }
};
